        <style type="text/css">
            html, body {
            margin: 0;
            height: 100%;
            }   
            div.img{
                position:absolute; 
                width: 100%; 
                height: 100%;
            }
            div.img > img{
                width: 100%; 
                height: 100%;
                background-position: center;
                background-repeat: no-repeat;
                background-size: cover;
            }
            div.img > div{
                position: absolute; 
                left: 50%; 
                margin-left: -120px; 
                top: 50%; 
                margin-top: -75px; 
                width:50%; 
                height: 50%; 
                color: #FFF;
            }
            *{
                margin: 0px;
                padding: 0px;
                box-sizing: border-box;
            }
            nav{
                display: flex;
                justify-content: space-around;
                align-items: center;
                min-height: 8vh;
                font-family: 'Poppins', sans-serif;
                background-color: #5D4954;
            }
            .logo{
                color: rgb(226,226,226);
                text-transform: uppercase;
                letter-spacing: 5px;
                font-size: 20px;
                
            }
            .nav-links{
                display: flex;
                justify-content: space-around;
                width: 35%;
            }
            .nav-links li{
                list-style: none;
                position:relative;
            }
            .nav-links a{
                color: rgb(226,226,226);
                text-decoration: none;
                letter-spacing: 3px;
                font-weight: bold;
                font-size: 14px;
                
            }
            .nav-links li ul{
                position:absolute;
                top:25px;
                left:0;
                background-color:#fff;
                display:none;
            }
            
            .nav-links li:hover ul, .nav-links li.over ul{
                display:block;
            }
            
            .nav-links li ul li{
            border:1px solid #c0c0c0;
            display:block;
            width:150px;
            }
            
            .nav-links ul li a{
                text-decoration: none;
                color:#fff;
            }
            
       
            .dropbtn {
  background-color: #5D4954;
  color: white;
  padding: 16px;
  font-size: 16px;
  border: none;
  font-family: 'Poppins', sans-serif;
}

.dropdown {
  position: relative;
  display: inline-block;
}

.dropdown-content {
  display: none;
  position: absolute;
  background-color: #f1f1f1;
  min-width: 160px;
  box-shadow: 0px 8px 16px 0px rgba(0,0,0,0.2);
  z-index: 1;
}

.dropdown-content a {
  color: black;
  padding: 12px 16px;
  text-decoration: none;
  display: block;
}

.dropdown-content a:hover {background-color: #5D4954;}

.dropdown:hover .dropdown-content {display: block;}

.dropdown:hover .dropbtn {background-color: #5D4954;}
        </style>
